import React from "react";
import photo from "../img/standing.JPEG"

// The home page.
const Home = () => {
  return (
  <div class="standard">
  <div class="flex-container">
   <div class="photo-container">
     <img class="standing" src={photo} alt=""/>
    </div>
    <div>
         <h1>
            Josh Bottelberghe
         </h1>
         </div>
    </div>
    </div>
  );
};

export default Home;
